package stalbans.inertiagames;public class Corner1GameEmbed extends SquareGameBoard {	public String getTitle() {		return "Corner 1";	}	public String getInstructionsLoc() {		return "text/corner1.html";	}	public RocketPanel newGamePanel() throws Exception {		return new CornerPanel(this);	}		public Rocket newStartingRocket() {		return new Rocket(20, 20, 2, 2);	}		public void initGamePanelHook() {		((CornerPanel)gamePanel).setCorner(360, 210);	}}